import React from 'react';
import Rate from './rating/rating';
import HeaderReview from './header_review/header_review';

class Review extends React.Component{
  render(){
    return(
      <div>
        <HeaderReview/>
        <Rate/>
      </div>
    )
  }
}
export default Review
